111	1	0	f	\N	2025-04-26 22:22:27.616701+00	[{"id": "dea3a321-9297-4fda-9449-fdd4c3f538de", "type": "text", "title": "", "content": "<p><em>Memory Verse </em></p><p><strong><a href=\\"https://www.bible.com/bible/111/PSA.133.1.NIV\\" target=\\"_blank\\" rel=\\"noopener noreferrer\\">Psalm 133:1</a></strong></p><p>“Behold how good and pleasant it is for brothers to dwell together in unity.”</p><p>1) Take two pictures of yourself, one from the front and one from the side. These will be used for you to document your great results. We will remind you to retake these picture each time you go to the next level. Use the Timestamp app to post the date on your pics for yourself.</p><p>(YOU WILL KEEP THESE PICTURES.  DO NOT POST.  THESE ARE FOR YOU.  YOU WILL BE VERY EXCITED THAT YOU DID THIS DOCUMENTING.)</p><p>2) Weigh yourself in pounds.  We know that this is not a true measuring tool of fitness, but it is a measuring tool that we like to track. We will remind you to weigh yourself again each time you go to the next level.  (YOU WILL KEEP THESE PICTURES.  DO NOT POST.  THESE ARE FOR YOU.  YOU WILL BE VERY EXCITED THAT YOU DID THIS DOCUMENTING.)</p><p>3)  Measure yourself around your waist where your belly button is located.  Lost inches around the waist is another great measuring tool.  We will remind you to measure yourself again each time you go to the next level.  (YOU WILL KEEP THESE PICTURES.  DO NOT POST.  THESE ARE FOR YOU.  YOU WILL BE VERY EXCITED THAT YOU DID THIS DOCUMENTING.)</p><p>1) Workouts:</p><p>Assignment: </p><p>-Perform these 5 Lean Workouts in this order, one per day.  You choose which 2 days you will have off.</p><p>Fuel Plan-( First 4 Weeks):</p><p>Assignment: </p><p>-Eat three (3) Fuel meals per day, six (6) days per week. </p><p>-Upload a proof pic of each of the 3 meals per day on your Group slack channel for points per day.</p><p>Here is what makes Level 1-meals an approved meal.  Do NOT consume these two items.</p><p>1)  NO Simple sugars </p><p>2) NO Dairy products </p><p>1) NO Simple sugars:</p><p>Carbohydrates (sugars) are a component of food that supplies energy through calories to the body. The energy value of digestible carbohydrates is four calories per gram. Along with proteins and fats, carbohydrates are one of the three macronutrients that your body needs.   We need all three to be healthy.</p><p>The two basic types of carbohydrates that we consume daily are Starches, called Complex carbohydrates (whole) and sugars, called Simple carbohydrates (refined).  Whole carbs are unprocessed and contain the fiber found naturally in the food, while refined carbs have been processed and had the natural fiber stripped out. </p><p>Examples of whole carbs include vegetables, whole fruit, legumes, sweet potatoes and whole grains used for sustained energy. These foods are healthy.  Refined carbs include sugar-sweetened beverages, fruit juices, pastries, bread, white pasta, white rice and others causing major spikes in blood sugar levels, which leads to a crash that can trigger hunger and cravings for more simple carb foods.</p><p>This is the \\"blood sugar roller coaster\\" that many people are familiar with.</p><p>Only whole carbs for you on this journey. By whole, we mean single ingredient foods in their original form: not mixed or processed with preservatives.</p><p>Fuel Foods to eat that contain NO unhealthy Simple sugars: </p><p>All Vegetables:</p><p>spinach</p><p>kale</p><p>carrots</p><p>broccoli</p><p>chard</p><p>ginger</p><p>sweet potatoes</p><p>red potatoes</p><p>squash</p><p>Whole fruits:</p><p>Berries </p><p>blueberries</p><p>blackberries</p><p>raspberries</p><p>strawberries</p><p>cranberries</p><p>apples</p><p>bananas</p><p>grapefruits</p><p>grapes</p><p>pomegranate</p><p>cherries</p><p>avocados</p><p>Legumes:</p><p>beans</p><p>peas</p><p>lentils</p><p>Nuts: </p><p>almonds</p><p>walnuts</p><p>cashews</p><p>Seeds:</p><p>chia </p><p>pumpkin</p><p>Whole grains: choose grains that are truly whole</p><p>quinoa</p><p>brown rice</p><p>whole grain oats</p><p>2) NO Dairy products:</p><p>The definition of dairy includes foods produced from the milk of mammals, such as cows, sheep, goats.  Milk and any food products made from milk, such as cheese, cream, butter, milk yogurt, etc...(eggs are NOT dairy)</p><p>IMPORTANT!!!!!</p><p>The only sweetener allowed is Stevia it is all natural.  Diet drinks or foods with other sweeteners in them are non-compliant.  </p>"}]	1
