70	8	0	f	\N	2025-04-26 21:41:15.757511+00	[{"id": "7ebc8503-e37d-4629-beb5-a21760505231", "type": "text", "title": "", "content": "<p><em>Memory Verse</em></p><p><strong><a href=\\"https://www.bible.com/bible/111/GAL.5.24-26.NIV\\" target=\\"_blank\\" rel=\\"noopener noreferrer\\">Galatians 5:24-26</a></strong></p><p>“And those who are Christ’s have crucified the flesh with its passions and desires.  If we live in the Spirit, let us also walk in the Spirit.  Let us not become conceited, provoking one another, envying one another.”</p><p>​</p><p>The Acts are the history of the early church picking up right where the Gospel of John leaves off.  There are many miraculous events most importantly the spread of the Gospel through the known world to every person regardless of where they were born. There have been many church splits and wars fought over different interpretations of this the most controversial book in the Bible. I thought about skipping right to the Epistles to avoid any conflict or negativity, but this Book sets up the<br />context for all the Epistles and with so many new believers in the program thought it critical to move forward. Please keep your comments and discussions respectful and honor The Lord.  As men and believers, we may not agree on every verse of scripture and that is OK God will sort it all out in<br />Heaven on that Glorious Day. We all agree everything recorded in Acts happened literally and exactly as recorded in Holy Scripture which is the focus of this Bible study.</p><p>​</p><p>Here is the formula for your RESULTS this week…</p><ol><li><strong>Workouts:</strong></li></ol><p><strong>Assignment: </strong></p><p>-Perform these Lean Workouts in this order, one per day.  You choose which 2 days you will have off.</p><p>​</p><p>-Begin each Lean Workout with this Warm Up video for mental and physical preparation.</p><p><strong>WARM UP VIDEO</strong></p><p><a href=\\"<div class=\\"video-wrapper\\"><iframe src=\\"https://www.youtube.com/embed/JT49h1zSD6I\\" title=\\"YouTube video player\\" frameborder=\\"0\\" allow=\\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share\\" allowfullscreen></iframe></div></a></p><p>Fuel Plan Same as Week 1.  </p><p>No dairy, No Sugar</p><p>The only sweetener allowed is Stevia it is all natural.  Diet drinks or foods with other sweeteners in them are non-compliant.  </p><p><strong>Or!!!!!! </strong></p><p><strong>If you want the most out of Sparta!</strong></p><p>Only single ingredient foods unless you prepare them yourself.  No Diet or carbonated beverages.  Only 2 earned meals for this week.  Water or black coffee tea unsweetened of course.  </p>"}]	1
