74	12	0	f	\N	2025-04-26 21:42:08.621051+00	[{"id": "4d1a8762-2ed3-420c-a163-6668d4096696", "type": "text", "title": "", "content": "<p><em>Memory Verse</em></p><p><strong><a href=\\"https://www.bible.com/bible/111/1JN.5.4,5.NIV\\" target=\\"_blank\\" rel=\\"noopener noreferrer\\">1 John 5:4,5</a><br /></strong>“For whatever is born of God overcomes the world. And this is the victory that has overcome the world-our faith. Who is he who overcomes the world? He who believes that Jesus is the Son of God.”</p><p><br /><strong>ATTENTION!!! The reps and sets have changed!!!!</strong></p><p>Last week gentlemen you are almost there! You are about to become a Spartan for life! Joining a brotherhood of believers committed to excellence and victory in all areas of our lives! The work outs will change up a little bit this week. This will be how to do the reps and sets moving forward in your<br />journey towards Mighty Men of God the next level in the program. Each prescribed exercise will be four sets, first set will be light resistance band or close distance to the anchor point 20 to 30 fast reps to get the muscles warmed up and blood flowing. The next set will be a little more resistance 10 to 20 reps, next set more resistance 8 to 12 reps, and finally last set more resistance slow reps and get maybe 4 to 6 reps. Wow you will get such a great pump on and really fire every muscle cell! This will take more time, but it is the last week, and we are pushing ourselves to the limit. You will feel a sense of satisfaction and accomplishment few Christian men have experienced at the end of this week!</p><p>​</p><p><strong>Here is the formula for your RESULTS this week...</strong></p><p><strong>​</strong></p><p><strong>1)  Workouts:</strong></p><p>Assignment: </p><p>-Perform these Lean Workouts in this order, one per day.  You choose which 2 days you will have off.</p><p>​</p><p>-Begin each Lean Workout with this Warm Up video for mental and physical preparation.</p><p><strong>WARM UP VIDEO</strong></p><p>​​<a href=\\"<div class=\\"video-wrapper\\"><iframe src=\\"https://www.youtube.com/embed/JT49h1zSD6I\\" title=\\"YouTube video player\\" frameborder=\\"0\\" allow=\\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share\\" allowfullscreen></iframe></div></a></p>"}]	1
