168	13	0	f	\N	2025-05-19 20:40:57.798257+00	[{"id": "3bbc6936-3e6b-4bff-b090-f7aa812123d0", "type": "text", "title": "", "content": "<p><em>Memory Verse</em></p><p><strong><a href=\\"https://www.bible.com/bible/111/PHP.1.27.NIV\\" target=\\"_blank\\" rel=\\"noopener noreferrer\\">Philippians 1:27</a></strong></p><p>“Only let your manner of life be worthy of the gospel of Christ, so that whether I come and see you or am absent, I may hear of you that you are standing firm in one spirit, with one mind striving side by side for the faith of the gospel. “<br /></p><p>Welcome Spartans to the next level of your journey in Sparta Complete Wellness.  You have graduated and you now have the rank of Corporal and may lead a team of recruits.  Good effective teams are guys you may know that have seen the unmistakable changes in you over the last twelve weeks.  Invite your friends and we will get you set up as a team leader.  We have other men you may not know that will need an experienced Spartan to help them through their journey to become a Spartan for Life.  Please let me know if you are willing.  Leading is mostly being an example to your team and answering questions.  We are a ministry of presence.  We show up every day and you have already been doing that for twelve weeks.  Thank you for answering the high call of God on your life and being obedient to the Great Commission Mathew 28:19 “Go therefore and make disciples of all nations, baptizing them in the name of the Father and of the Son and of the Holy Spirit.” Remember anyone in the world with a smart phone can participate.  </p><p><strong>Here is the formula for your RESULTS this week...</strong></p><p><strong>​</strong></p><p><strong>1)  Workouts:</strong></p><p>Assignment: </p><p>-Perform these Lean Workouts in this order, one per day.  You choose which 2 days you will have off.</p><p>​</p><p>-Begin each Lean Workout with this Warm Up video for mental and physical preparation.</p><p><strong>WARM UP VIDEO</strong></p><p>​​<a href=\\"<div class=\\"video-wrapper\\"><iframe src=\\"https://www.youtube.com/embed/JT49h1zSD6I\\" title=\\"YouTube video player\\" frameborder=\\"0\\" allow=\\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share\\" allowfullscreen></iframe></div></a></p>"}]	1
202	27	0	f	\N	2025-09-10 21:43:40.065694+00	[{"id": "6de5b903-ce89-4476-89e8-5abf7d3e099a", "type": "text", "title": "", "content": "<p><em>Memory Verse</em></p><p><strong><a href=\\"https://www.bible.com/bible/111/GAL.5.16.NIV\\" target=\\"_blank\\" rel=\\"noopener noreferrer\\">Galatians 5:16</a></strong></p><p> I say then:  Walk in the Spirit, and you shall not fulfill the lust of the flesh.  </p><p>Here is the formula for your RESULTS this week...</p><p><strong>Workouts reps and sets have changed to shock the muscles!  </strong></p><p><strong>​</strong></p><p><strong>1)  Workouts:</strong></p><p>Assignment: </p><p>-Perform these Lean Workouts in this order, one per day.  You choose which 2 days you will have off.</p><p>​</p><p>-Begin each Lean Workout with this Warm Up video for mental and physical preparation.</p><p><strong>Make sure to warm up!</strong></p><p>First Set:  <a id=\\"_Hlk108378878\\"></a>15 reps (2 second count)</p><p>Super set with different exercises to allow muscles to rest between sets but without stopping.  </p><p>Second Se<a id=\\"_Hlk103877860\\"></a>t: 15 reps (2 second count)   </p><p>Third Set: <a id=\\"_Hlk104142376\\"></a>15 reps (2 second count)</p><p>Fourth Set: 15 reps (2 second count)</p><p>This week focus on the last two sets.  If you have to rest in between to get the fifteen reps or go down a band width please do not hesitate but do your best to get them all with significant resistance.  Also you may split Day 1, 3, and 5 into two work outs one fasting in the morning and one after work.  </p><p><strong>WARM UP VIDEO</strong></p><p>​​<a href=\\"<div class=\\"video-wrapper\\"><iframe src=\\"https://www.youtube.com/embed/JT49h1zSD6I\\" title=\\"YouTube video player\\" frameborder=\\"0\\" allow=\\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share\\" allowfullscreen></iframe></div></a></p><p><strong><em>​</em></strong></p>"}]	1
