194	19	0	f	\N	2025-09-10 21:41:50.005493+00	[{"id": "7f02ca4d-7eac-45d2-85b2-eb2d41c06c54", "type": "text", "title": "", "content": "<p><em>Memory Verse</em></p><p><strong>1 Cor 1:18</strong></p><p>“For the word of the cross is folly to those who are perishing, but to us who are being saved it is the Power of God.”</p><p>Here is the formula for your RESULTS this week...</p><p>Workouts reps and sets have changed to shock the muscles!  </p><p><strong>​</strong></p><p><strong>1)  Workouts:</strong></p><p>Assignment: </p><p>-Perform these Lean Workouts in this order, one per day.  You choose which 2 days you will have off.</p><p>​</p><p>-Begin each Lean Workout with this Warm Up video for mental and physical preparation.</p><p><strong>Maintenance week we just want to warm up and fire the muscle cells this week gentlemen.  Get lots of rest and hydrate cause next week we get after it again.  </strong></p><p>First Set:  15 reps</p><p>Second Set:  15 reps</p><p>Third Set: 15 reps</p><p><strong>WARM UP VIDEO</strong></p><p>​​<a href=\\"<div class=\\"video-wrapper\\"><iframe src=\\"https://www.youtube.com/embed/JT49h1zSD6I\\" title=\\"YouTube video player\\" frameborder=\\"0\\" allow=\\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share\\" allowfullscreen></iframe></div></a></p>"}]	1
204	29	0	f	\N	2025-09-10 21:44:10.43261+00	[{"id": "e259c3fc-d6b9-4099-b53c-ffa2fd29c944", "type": "text", "title": "", "content": "<p><em>Memory Verse</em></p><p><strong><a href=\\"https://www.bible.com/bible/111/2TH.3.13, 16.NIV\\" target=\\"_blank\\" rel=\\"noopener noreferrer\\">2 Thessalonians 3:13, 16</a></strong></p><p>13- “As for you brothers do not grow weary in doing good.”</p><p>16- “Now may the Lord of peace himself give you peace at all times in every way.  The Lord be with you all.”   </p><p>Here is the formula for your RESULTS this week...</p><p><strong>Workouts reps and sets have changed to shock the muscles!  </strong></p><p><strong>​</strong></p><p><strong>1)  Workouts:</strong></p><p>Assignment: </p><p>-Perform these Lean Workouts in this order, one per day.  You choose which 2 days you will have off.</p><p>​</p><p>-Begin each Lean Workout with this Warm Up video for mental and physical preparation.</p><p>OR YOU PICK YOUR WORK OUT THIS WEEK</p><p>I need 2 movement work outs 40 min and 4 Band, weights, calisthenics, kettle bells or mixture making sure to target trouble areas!  </p><p><strong>Make sure to warm up!</strong></p><p>First Set:  <a id=\\"_Hlk108378878\\"></a>15 reps (2 second count)</p><p>Super set with different exercises to allow muscles to rest between sets but without stopping.  </p><p>Second Se<a id=\\"_Hlk103877860\\"></a>t: 12 reps (2 second count)  <a id=\\"_Hlk108979078\\"></a>Increase Resistance</p><p>Third Set: <a id=\\"_Hlk104142376\\"></a>10 reps (2 second count) Increase Resistance</p><p>Fourth Set: 8 reps (2 second count) Increase Resistance</p><p>This week focus on the last two sets.  If you have to rest in between to get the fifteen reps or go down a band width please do not hesitate but do your best to get them all with significant resistance.  Also you may split Day 1, 3, and 5 into two work outs one fasting in the morning and one after work.  </p><p><strong>WARM UP VIDEO</strong></p><p>​​<a href=\\"<div class=\\"video