210	35	0	f	\N	2025-09-10 21:45:38.811822+00	[{"id": "9680d878-b39e-4501-9e9a-776aaa95e4f3", "type": "text", "title": "", "content": "<p><em>Memory Verse</em></p><p><strong><a href=\\"https://www.bible.com/bible/111/LUK.11.2-4.NIV\\" target=\\"_blank\\" rel=\\"noopener noreferrer\\">Luke 11:2-4</a> </strong></p><p>“So He said to them, When you pray, say:  Our Father in heaven Hallowed be Your name. Your kingdom come.  Your will be done on earth as it is in heaven.  Give us this day our daily bread and forgive us our sins as we also forgive everyone who is indebted to us.  And do not lead us into temptation but deliver us from the evil one.”</p><p>Here is the formula for your RESULTS this week...</p><p><strong>Workouts reps and sets have changed to shock the muscles!  </strong></p><p><strong>​</strong></p><p><strong>1)  Workouts:</strong></p><p>Assignment: </p><p>-Perform these Lean Workouts in this order, one per day.  You choose which 2 days you will have off.</p><p>​</p><p>-Begin each Lean Workout with this Warm Up video for mental and physical preparation.</p><p>OR YOU PICK YOUR WORK OUT THIS WEEK</p><p>I need 3 movement work outs 40 min and 4 Band, weights, calisthenics, kettle bells or mixture making sure to target trouble areas!  </p><p><strong>Make sure to warm up!</strong></p><p>First Set:  <a id=\\"_Hlk108378878\\"></a>15 reps (2 second count)</p><p>Super set with different exercises to allow muscles to rest between sets but without stopping.  </p><p>Second Se<a id=\\"_Hlk103877860\\"></a>t: 12 reps (2 second count)  <a id=\\"_Hlk108979078\\"></a>Increase Resistance</p><p>Third Set: <a id=\\"_Hlk104142376\\"></a>10 reps (2 second count) Increase Resistance</p><p>Fourth Set: 8 reps (2 second count) Increase Resistance</p><p>This week focus on the last two sets.  If you have to rest in between to get the fifteen reps or go down a band width please do not hesitate but do your best to get them all with significant resistance.  Also you may split Day 1, 3, and 5 into two work outs one fasting in the morning and one after work.  </p><p><strong>WARM UP VIDEO</strong></p><p>​​<a href=\\"<div class=\\"video-wrapper\\"><iframe src=\\"https://www.youtube.com/embed/JT49h1zSD6I\\" title=\\"YouTube video player\\" frameborder=\\"0\\" allow=\\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share\\" allowfullscreen></iframe></div></a></p><p><strong><em>​</em></strong></p>"}]	1
