146	10	3	f	\N	2025-04-26 22:36:24.646978+00	[{"id": "86d27fb7-e959-411d-a453-73ccd025c293", "type": "text", "title": "Week 10 - Day 3", "content": "<p><br />Comment and Questions in Team Huddle for points!</p><p>​</p><p><strong>Front Squat</strong>- 3 burnout sets back-to-back with ten seconds of rest between sets start with lighter band and add band width each set if possible.  </p><p><a href=\\"<div class=\\"video-wrapper\\"><iframe src=\\"https://www.youtube.com/embed/abm1ZT77YSo\\" title=\\"YouTube video player\\" frameborder=\\"0\\" allow=\\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share\\" allowfullscreen></iframe></div></a></p><p><br /><strong>Shoulder Raises</strong>- <a id=\\"_Hlk97484545\\"></a>3 burnout sets back-to-back with ten seconds of rest between sets start with lighter band and add band width each set if possible.  </p><p><a href=\\"<div class=\\"video-wrapper\\"><iframe src=\\"https://www.youtube.com/embed/NHzOR_VNbl4\\" title=\\"YouTube video player\\" frameborder=\\"0\\" allow=\\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share\\" allowfullscreen></iframe></div></a></p><p><br /><strong>Dead Lift with Shrug modification</strong>- 3 burnout sets back-to-back with ten seconds of rest between sets start with lighter band and add band width each set if possible.  </p><p><a href=\\"<div class=\\"video-wrapper\\"><iframe src=\\"https://www.youtube.com/embed/tT8EcV8ypmQ\\" title=\\"YouTube video player\\" frameborder=\\"0\\" allow=\\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share\\" allowfullscreen></iframe></div></a></p><p>​</p><p><strong>Mid Anchor Rear Delt</strong>- 3 burnout sets back-to-back with ten seconds of rest between sets start with lighter band and add band width each set if possible.  </p><p><a href=\\"<div class=\\"video-wrapper\\"><iframe src=\\"https://www.youtube.com/embed/SGtoinlmc0o\\" title=\\"YouTube video player\\" frameborder=\\"0\\" allow=\\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share\\" allowfullscreen></iframe></div></a></p><p><br /><strong>High Anchor Cork Screw</strong>- 3 burnout sets back-to-back with ten seconds of rest between sets start with lighter band and add band width each set if possible.  </p><p><a href=\\"<div class=\\"video-wrapper\\"><iframe src=\\"https://www.youtube.com/embed/LsD-TI4GwAw\\" title=\\"YouTube video player\\" frameborder=\\"0\\" allow=\\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share\\" allowfullscreen></iframe></div></a></p><p><strong>Sumo Deadlift</strong>-3 burnout sets back-to-back with ten seconds of rest between sets start with lighter band and add band width each set if possible.  </p><p><a href=\\"<div class=\\"video-wrapper\\"><iframe src=\\"https://www.youtube.com/embed/0lpcxQvBTGY\\" title=\\"YouTube video player\\" frameborder=\\"0\\" allow=\\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share\\" allowfullscreen></iframe></div></a></p><p><br /><strong>Mid Anchor Fly</strong>-3 burnout sets back-to-back with ten seconds of rest between sets start with lighter band and add band width each set if possible.  </p><p><a href=\\"<div class=\\"video-wrapper\\"><iframe src=\\"https://www.youtube.com/embed/SF1O1ahvg-Q\\" title=\\"YouTube video player\\" frameborder=\\"0\\" allow=\\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share\\" allowfullscreen></iframe></div></a></p><p> </p><p><strong>Push Up Knee to Elbow</strong>- 3 burnout sets back-to-back with ten seconds of rest between sets.</p><p><a href=\\"<div class=\\"video-wrapper\\"><iframe src=\\"https://www.youtube.com/embed/A9hg1-bEsY0\\" title=\\"YouTube video player\\" frameborder=\\"0\\" allow=\\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share\\" allowfullscreen></iframe></div></a></p><p><br />Work out time approx. 35 min<br /></p><p>Sweaty Selfie for Points!</p><p>​</p>"}]	1
