195	20	0	f	\N	2025-09-10 21:42:03.888866+00	[{"id": "fdeaefb6-4219-4b61-a7e4-91fecca92cf3", "type": "text", "title": "", "content": "<p><em>Memory Verse</em></p><p><strong><a href=\\"https://www.bible.com/bible/111/1CO.6.19-20.NIV\\" target=\\"_blank\\" rel=\\"noopener noreferrer\\">1 Corinthians 6:19-20</a></strong></p><p>“Or do you not know that your body is the temple of the Holy Spirit who is in you, whom you have from God, and you are not your own?  For you were bought with a price; therefore glorify God in your body and spirit, which are God’s.”</p><p>Here is the formula for your RESULTS this week...</p><p><strong>Workouts reps and sets have changed to shock the muscles!  </strong></p><p><strong>​</strong></p><p><strong>1)  Workouts:</strong></p><p>Assignment: </p><p>-Perform these Lean Workouts in this order, one per day.  You choose which 2 days you will have off.</p><p>​</p><p>-Begin each Lean Workout with this Warm Up video for mental and physical preparation.</p><p><strong>Here we go again!  Time to fire every muscle cell to failure!  </strong></p><p>First Set:  20 seconds on hard and fast light resistance.  10 Seconds of rest.  </p><p>Second Set:  <a id=\\"_Hlk103877860\\"></a>Increase resistance 20 seconds hard and fast then 10 seconds of rest.  </p><p>Third Set: Increase resistance 20 seconds hard and fast then 10 seconds of rest.  </p><p>Fourth Set: Increase resistance 20 seconds hard and fast then 10 seconds of rest.  Or if in muscle failure contract and hold the last rep for 20 seconds.  </p><p><strong>WARM UP VIDEO</strong></p><p>​​<a href=\\"<div class=\\"video-wrapper\\"><iframe src=\\"https://www.youtube.com/embed/JT49h1zSD6I\\" title=\\"YouTube video player\\" frameborder=\\"0\\" allow=\\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share\\" allowfullscreen></iframe></div></a></p><p><strong><em>​</em></strong></p>"}]	1
