200	25	0	f	\N	2025-09-10 21:43:08.962586+00	[{"id": "175c43b0-28af-4477-ac58-ecd483cd9d40", "type": "text", "title": "", "content": "<p><em>Memory Verse</em></p><p><strong><a href=\\"https://www.bible.com/bible/111/MAT.16.24-25.NIV\\" target=\\"_blank\\" rel=\\"noopener noreferrer\\">Matthew 16:24-25</a></strong></p><p>Then Jesus said to His disciples, “If anyone desires to come after Me let him deny himself, and take up his cross, and follow Me.  For whoever desires to save his life will lose it, but whoever loses his life for My sake will find it.”</p><p>Here is the formula for your RESULTS this week...</p><p><strong>Workouts reps and sets have changed to shock the muscles!  </strong></p><p><strong>​</strong></p><p><strong>1)  Workouts:</strong></p><p>Assignment: </p><p>-Perform these Lean Workouts in this order, one per day.  You choose which 2 days you will have off.</p><p>​</p><p>-Begin each Lean Workout with this Warm Up video for mental and physical preparation.</p><p><strong>Change Up!  Time to fire every muscle cell to failure!  </strong></p><p>First Set:  10 reps slow controlled (each rep should take at least 4 seconds) </p><p>PERFECT FORM! </p><p>Second Set:  <a id=\\"_Hlk103877860\\"></a>Increase Resistance 8 reps slow controlled   </p><p>Third Set: <a id=\\"_Hlk104142376\\"></a>Increase Resistance 6 reps slow controlled </p><p>Fourth Set: Increase Resistance 4 reps (maybe) slow </p><p><strong>WARM UP VIDEO</strong></p><p>​​<a href=\\"<div class=\\"video-wrapper\\"><iframe src=\\"https://www.youtube.com/embed/JT49h1zSD6I\\" title=\\"YouTube video player\\" frameborder=\\"0\\" allow=\\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share\\" allowfullscreen></iframe></div></a></p>"}]	1
