deo player\\" frameborder=\\"0\\" allow=\\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share\\" allowfullscreen></iframe></div></a></p><p> </p><p><strong>High Anchor Triceps Extension</strong>-3 sets 15 reps each side</p><p><a href=\\"<div class=\\"video-wrapper\\"><iframe src=\\"https://www.youtube.com/embed/I5nwy6dNFzM\\" title=\\"YouTube video player\\" frameborder=\\"0\\" allow=\\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share\\" allowfullscreen></iframe></div></a></p><p><strong>High Anchor Banded Side Crunch</strong>- 3 sets 15 reps</p><p><a href=\\"<div class=\\"video-wrapper\\"><iframe src=\\"https://www.youtube.com/embed/2-uS6eQFRW4\\" title=\\"YouTube video player\\" frameborder=\\"0\\" allow=\\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share\\" allowfullscreen></iframe></div></a></p><p><strong>Plank Pull Through</strong>- </p><p><a href=\\"<div class=\\"video-wrapper\\"><iframe src=\\"https://www.youtube.com/embed/4dJRriTtH1g\\" title=\\"YouTube video player\\" frameborder=\\"0\\" allow=\\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share\\" allowfullscreen></iframe></div></a></p><p><a id=\\"_Hlk105314385\\"></a>Burn out or just do as many as you can do in one set each side.  Go to your knees as a modification to get all the reps in you can after plank position on each side.  </p><p><br />Sweaty Selfie for Points!</p><p><br />Work out time Approx. 40 minutes</p><p>​</p>"}]	1
206	31	0	f	\N	2025-09-10 21:44:46.929366+00	[{"id": "9781f2c2-740a-41c4-97c1-97d90ed5cf66", "type": "text", "title": "", "content": "<p><em>Memory Verse</em></p><p><strong><a href=\\"https://www.bible.com/bible/111/2TI.1.7.NIV\\" target=\\"_blank\\" rel=\\"noopener noreferrer\\">2 Timothy 1:7</a></strong></p><p>“For we have not been given a spirit of fear, but of power and love and of a sound mind.”</p><p>Here is the formula for your RESULTS this week...</p><p><strong>Workouts reps and sets have changed to shock the muscles!  </strong></p><p><strong>​</strong></p><p><strong>1)  Workouts:</strong></p><p>Assignment: </p><p>-Perform these Lean Workouts in this order, one per day.  You choose which 2 days you will have off.</p><p>​</p><p>-Begin each Lean Workout with this Warm Up video for mental and physical preparation.</p><p>OR YOU PICK YOUR WORK OUT THIS WEEK</p><p>I need 3 movement work outs 40 min and 4 Band, weights, calisthenics, kettle bells or mixture making sure to target trouble areas!  </p><p><strong>Make sure to warm up!</strong></p><p>First Set:  <a id=\\"_Hlk108378878\\"></a>15 reps (2 second count)</p><p>Super set with different exercises to allow muscles to rest between sets but without stopping.  </p><p>Second Se<a id=\\"_Hlk103877860\\"></a>t: 12 reps (2 second count)  <a id=\\"_Hlk108979078\\"></a>Increase Resistance</p><p>Third Set: <a id=\\"_Hlk104142376\\"></a>10 reps (2 second count) Increase Resistance</p><p>Fourth Set: 8 reps (2 second count) Increase Resistance</p><p>This week focus on the last two sets.  If you have to rest in between to get the fifteen reps or go down a band width please do not hesitate but do your best to get them all with significant resistance.  Also you may split Day 1, 3, and 5 into two work outs one fasting in the morning and one after work.  </p><p><strong>WARM UP VIDEO</strong></p><p>​​<a href=\\"<div class=\\"video-wrapper\\"><iframe src=\\"https://www.youtube.com/embed/JT49h1zSD6I\\" title=\\"YouTube video player\\" frameborder=\\"0\\" allow=\\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share\\" allowfullscreen></iframe></div></a></p>"}]	1
