ll with significant resistance.  Also you may split Day 1, 3, and 5 into two work outs one fasting in the morning and one after work.  </p><p><strong>WARM UP VIDEO</strong></p><p>​​<a href=\\"<div class=\\"video-wrapper\\"><iframe src=\\"https://www.youtube.com/embed/JT49h1zSD6I\\" title=\\"YouTube video player\\" frameborder=\\"0\\" allow=\\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share\\" allowfullscreen></iframe></div></a></p>"}]	1
