219	44	0	f	\N	2025-09-10 21:47:33.005213+00	[{"id": "3258ba43-460c-4a90-8630-e92bbd31edd4", "type": "text", "title": "", "content": "<p><em>Memory Verse</em></p><p><strong><a href=\\"https://www.bible.com/bible/111/PSA.18. 29-30.NIV\\" target=\\"_blank\\" rel=\\"noopener noreferrer\\">Psalms 18: 29-30</a> </strong></p><p>“For by you I can run against a troop, and by my God I can leap over a wall.  This God his way is perfect; the word of the Lord proves true; he is a shield for all those who take refuge in him.”  </p><p>Here is the formula for your RESULTS this week...</p><p><strong>Workouts reps and sets have changed to shock the muscles!  </strong></p><p><strong>​</strong></p><p><strong>1)  Workouts:</strong></p><p>Assignment: </p><p>-Perform these Lean Workouts in this order, one per day.  You choose which 2 days you will have off.</p><p>​</p><p>-Begin each Lean Workout with this Warm Up video for mental and physical preparation.</p><p>OR YOU PICK YOUR WORK OUT THIS WEEK</p><p>I need 3 movement work outs 40 min and 4 Band, weights, calisthenics, kettle bells or mixture making sure to target trouble areas!  </p><p><strong>Make sure to warm up!</strong></p><p><strong>WARM UP VIDEO</strong></p><p>​​<a href=\\"<div class=\\"video-wrapper\\"><iframe src=\\"https://www.youtube.com/embed/JT49h1zSD6I\\" title=\\"YouTube video player\\" frameborder=\\"0\\" allow=\\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share\\" allowfullscreen></iframe></div></a></p>"}]	1
