16	161	scripture	“The Pharisees therefore said among themselves, “You see that you are accomplishing nothing. Look, the world has gone after Him!””\n‭‭John‬ ‭12‬:‭19‬ ‭NKJV‬‬\n\nDoes it seem like God is taking too long to answer your prayers?  His Purpose will be accomplished in your life not in your timing but in His perfect timing.  Waiting on the Lord is a developed skill.  Having seen Him come through for me over and over again I trust Him.  I rest in Him.  Not always easy when the bills are due, or when someone I love is sick or hurting but God is Faithful.  He has us all in the palm of His hand.  When we get to heaven we are given crowns.  We will throw them at His feet in praise because EVERYTHING He did for us here on earth will be revealed.  How great is our God?!  \n\n“Blessed is the man who endures temptation; for when he has been approved, he will receive the crown of life which the Lord has promised to those who love Him.”\n‭‭James‬ ‭1‬:‭12‬ ‭NKJV‬‬\n\n“and when the Chief Shepherd appears, you will receive the crown of glory that does not fade away.”\n‭‭I Peter‬ ‭5‬:‭4‬ ‭NKJV‬‬\n\n“the twenty-four elders fall down before Him who sits on the throne and worship Him who lives forever and ever, and cast their crowns before the throne, saying: “You are worthy, O Lord, To receive glory and honor and power; For You created all things, And by Your will they exist and were created.””\n‭‭Revelation‬ ‭4‬:‭10‬-‭11‬ ‭NKJV‬‬	\N	3	2025-02-25 17:31:03.953+00	\N	0	f	my_team	\N	\N	\N
